import { Link } from "react-router-dom"
import './header.css';

const Header = () => {
  return (
    <div class="header">
      <div class="left-item">
          <Link to="/">
              <p><strong>Klajdi Cami</strong></p>
          </Link>
      </div>
      <div class="right-item">
          <select class="form-select" id="languages" name="languages">
              <option value="en">English</option>
              <option value="gr">Greek</option>
              <option value="ge">German</option>
          </select>
      </div>
      <img src="images/moon.png" alt="" class="mode" id="darkmode" />
      <img src="images/sunny.png" alt="" class="mode" id="lightmode" />
  </div>
  );
}

export default Header;
